package Loops;

public class Nestedloop1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1;i<=3;i++)
		{
			System.out.print(i+" ");
		}
			System.out.println();
		{
			for(int i=4;i<=6;i++)
			{
				System.out.print(i+" ");
			}
		System.out.println();
		{
			for(int i=7;i<=9;i++)
			{
				System.out.print(i+" ");
			}
			System.out.println();
		}

	}
}
}

